function setupConnections() {
    connect(this.get('List'), 'selection', this.get('List1'), 'setSelection')
    connect(this.get('List1'), 'selection', this.get('List'), 'setSelection')

    connect(this.get('Slider'), "value", this.get('SliderValue'), "textString", {converter: 
        	function (v) { return String(v.toFixed(2)) }});
    connect(this.get('SliderValue'), "savedTextString", this.get('Slider'), "setValue", {converter: function (v) { return Number(v) || 0 }});
    connect(this.get('SliderWidth'), "savedTextString", this.get('Slider'), "setSliderExtent", {converter: function (v) { return Number(v) || 0 }});


    connect(this.get('Text1'), "textString", this.get('Text2'), "textString", {
        updater: function($upd, s) {
            var sr = this.sourceObj.isFocused() && this.sourceObj.getSelectionRange(); $upd(s); sr && this.sourceObj.setSelectionRange(sr[0], sr[1])}});
    connect(this.get('Text1'), "textString", this.get('Text3'), "textString", {
        updater: function($upd, s) {
            var sr = this.sourceObj.isFocused() && this.sourceObj.getSelectionRange(); $upd(s); sr && this.sourceObj.setSelectionRange(sr[0], sr[1])}});
    connect(this.get('Text1'), "priorSelectionRange", this.get('Selection'), "textString", {converter: function (range) { return this.sourceObj.selectionString() }});

    connect(this.get('Text2'), "textString", this.get('Text1'), "textString", {
        updater: function($upd, s) {
            var sr = this.sourceObj.isFocused() && this.sourceObj.getSelectionRange(); $upd(s); sr && this.sourceObj.setSelectionRange(sr[0], sr[1])}});
    connect(this.get('Text2'), "textString", this.get('Text3'), "textString", {
        updater: function($upd, s) {
            var sr = this.sourceObj.isFocused() && this.sourceObj.getSelectionRange(); $upd(s); sr && this.sourceObj.setSelectionRange(sr[0], sr[1])}});
    connect(this.get('Text2'), "priorSelectionRange", this.get('Selection'), "textString", {converter: function (range) { return this.sourceObj.selectionString() }});

    connect(this.get('Text3'), "textString", this.get('Text1'), "textString", {
        updater: function($upd, s) {
            var sr = this.sourceObj.isFocused() && this.sourceObj.getSelectionRange(); $upd(s); sr && this.sourceObj.setSelectionRange(sr[0], sr[1])}});
    connect(this.get('Text3'), "textString", this.get('Text2'), "textString", {
        updater: function($upd, s) {
            var sr = this.sourceObj.isFocused() && this.sourceObj.getSelectionRange(); $upd(s); sr && this.sourceObj.setSelectionRange(sr[0], sr[1])}});
    connect(this.get('Text3'), "priorSelectionRange", this.get('Selection'), "textString", {converter: function (range) { return this.sourceObj.selectionString() }});

    connect(this.get('Button1'), "value", this.get('Button2'), "setValue", {});
    connect(this.get('Button2'), "value", this.get('Button1'), "setValue", {});

    connect(this.get('Button3'), "value", this.get('Button4'), "setValue", {});
    connect(this.get('Button4'), "value", this.get('Button3'), "setValue", {});
}

